int longestSubarray(int* nums, int numsSize, int limit) {
    if(nums == NULL || numsSize == 0) {
        return 0;
    }

    int min_t,max_t;
    int min_t_index,max_t_index;
    int res = 0;
    int res_t = 0;

    int findStart = 0;
    int findCur = 0;
    int j;
    while(findCur < numsSize) {
        if((numsSize - findStart) <= res) {
            break;
        }

        min_t_index = findStart;
        max_t_index = findStart;
        for(int i = findStart+1;i<=findCur;i++) {
            if(nums[i] >= nums[max_t_index] ) {
                max_t_index = i;
            }
            if(nums[i] <= nums[min_t_index] ) {
                min_t_index = i;
            }
        }
        max_t = nums[max_t_index];
        min_t = nums[min_t_index];

        res_t = findCur - findStart + 1;

        for(j=findCur+1;j<numsSize;j++) {
            if(nums[j] > max_t) {
                if( (nums[j] - min_t) <= limit ) {
                    max_t_index = j;
                    max_t = nums[j];
                } else {
                    findStart = min_t_index + 1;
                    break;
                }
            } else if (nums[j] < min_t){
                if( (max_t - nums[j]) <= limit ) {
                    min_t_index = j;
                    min_t = nums[j];
                } else {
                    findStart = max_t_index + 1;
                    break;
                }
            } else {
                if(nums[j] == max_t) {
                    max_t_index = j;
                }
                if(nums[j] == min_t) {
                    min_t_index = j;
                }
            }
            res_t++;
        }

        findCur = j -1;
        printf("find_s is %d,find_cur is %d, min_t is %d,max is %d\n",findStart,findCur,min_t,max_t);

        if(res_t > res) {
            res = res_t;
        }
    }

    return res;
}


